      {id:3,
        name: "Ahmet Mehmet",
        jobTitle: "Industry Engineer",
        salary: "6500 USD"

      }
    ]
  }

  render() {
    return (
    <div>
      <JumbotronComp/>
        <div>
          <div className="col-md-4">
                <Users users = {this.state.users}/>
            </div>
          </div>
    </div>
        );
